		usersList: [
			{ id: 0, name: "Даун Иваныч", status: "Люблю жрать какахи"},
			{ id: 1, name: "Даун Лохыч", status: "Ты лоъх!" }
			]

}

const usersReducer = (state = initialState, action) => {
	
	return state;
